export function Welcome() {
  const [show, setShow] = useState(true)
  const { user } = useAuth()
  console.log(user)

  return (
    <div>
    {show?<div className='container-welcome'></div>:null}
      <img className='image-title' src={require('../img/font1.png')}alt='Rico burger'/>
      {<img className='image-burger' src={require('../img/burger_load.png')}
        alt='Rico burger' onClick={() => setShow(false)}/>}

        <div className='lds-ellipsis loader'>
        <div></div><div></div><div></div><div></div>
        </div>


</div>
    )}

